lagi aktif dan hari ini sudah spending berapa. Terus iklan yang jalannya berapa jumlahnya. Campaign-nya ada berapa jumlahnya, kayak gitu. Ini tools-nya, cara pakenya kita cuma tinggal collect bookmark-nya. Jadi tools-nya tuh ada disini. Nah, nanti tuh dia bakal ngedetect berapa banyak akun iklan yang terkoneksi sama akun Facebook kita. Nah, ini yang di atas itu akun yang lagi kita buka di pengelola iklannya. Nah, ini yang di bawah itu, akun iklan yang terkoneksi sama akun BNS kita. Jadi, tools-nya itu benar-benar berguna. Kenapa? Karena saya kalau misalnya mau ngelihat ini kan ada banyaknya akun iklan yang aktif. Terus ini bisa tau juga jumlah iklannya berapa. Kalau misalnya abu-abu itu artinya iklannya pending. Kalau misalnya hijau itu aktif, kalau nggak salah. Jadi, kita bisa tau di akun iklan itu iklan yang aktifnya berapa. Terus, spend harianya. Spend hari ini tuh udah berapa. Total spendingnya berapa juga udah bisa dilihat dari sini. Terus, disini juga ada shortcut buat minta tinjauan. Kalau misalnya akun kita diaktifkan, tinggal diklik disini. Nanti dia bakal otomatis masuk ke pom tinjauan. Jadi, kalau misalnya teman-teman punya banyak akun iklan, saya rekomendasiin buat pakai tools ini sih dari Mas Hadian. Soalnya benar-benar bermanfaat. Ini kita bisa lihat spend hari ini tuh kita udah spend Rp. 17.000 dari 33 akun iklan. Jadi, nggak harus ribet harus ganti-ganti akun iklan. Ini nggak usah buka banyak-banyak lagi. Kalau misalnya kita mau buka, mau lihat nih isi campaign dari akun iklan yang mana gitu. Sekarang kita tinggal klik ini aja. Nanti dia otomatis ngebuka campaign dari akun iklan yang kita pilih. Jadi, kita nggak usah ribet harus klik ini lagi, terus buka satu-satu, terus ngelihat lagi iklan mana aja yang aktif dan mana yang nggak aktif. Kayak gitu sih. Sekian video kali ini. Terima kasih. Wassalamualaikum warahmatullahi wabarakatuh.',NULL,NULL,'2024-12-13 08:10:14');
